const ReviewListItem = ({ content, rating, glutenFreeRange, value }) => {
  return (
    <li>
      <h4>Rating: {rating}</h4>
      <h5>Gluten free options: {glutenFreeRange}</h5>
      <h5>Value: {value}</h5>
      <p>{content}</p>
    </li>
  );
};

export default ReviewListItem;
